INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Allianz' , 'Az Allianz egy globális biztosítótársaság több mint 100 éves tapasztalattal a háta mögött. Széles körű biztosítási termékeket kínálnak, ideértve az élet-, egészség- és vagyonbiztosítást is. Az ügyfélközpontú szolgáltatásukra és az egyedi biztosítási megoldásokra való elkötelezettségükre büszkék.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Assistravel' , 'Az Assistravel egy utazási biztosítási társaság, amely szakosodott az utazók biztosítására. Különböző terveket kínálnak az egyedi igényeknek megfelelően, beleértve az egészségügyi, vagyonvédelmi és utazásmegszakítási biztosítást is.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Atlas' , 'Az Atlas egy nemzetközi biztosító, amely a vagyonbiztosításban és a kockázatkezelésben jártas. Céljuk az ügyfeleknek a lehető legjobb védelmet és szolgáltatást biztosítani, legyen szó akár egyéni, akár vállalati igényekről.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Axa' , 'Az Axa egy globális biztosítótársaság, amely a személyes és vállalati biztosítások széles skáláját kínálja, beleértve az egészség-, élet-, vagyon- és gépjárműbiztosítást is. Az Axa célja, hogy az ügyfeleknek a lehető legjobb biztonságot és bizalmat nyújtsa.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Cardif' , 'A Cardif egy pénzügyi biztosító, amely a lakásbiztosítás, az életbiztosítás és az egészségügyi biztosítás területén tevékenykedik. Az ügyfeleknek az egyedi igényeiknek megfelelő biztosítási megoldásokat kínálnak.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Cherrisk' ,'A Cherrisk egy online biztosítótársaság, amely az autó- és lakásbiztosítások széles skáláját kínálja. Az ügyfeleknek a lehető legjobb ár-érték arányú biztosítási megoldásokat kínálnak, amelyek könnyen kezelhetők az online felületen.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Clb' , 'A CLB egy hazai biztosítótársaság, amely az egészség- és életbiztosítások területén tevékenykedik. Az ügyfeleknek széles skálájú biztosítási megoldásokat kínálnak, amelyek magas minőségi színvonalon és megfizethető áron elérhetőek. Az ügyfélközpontú szolgáltatásra való elkötelezettségükkel igyekeznek biztosítani, hogy az ügyfelek mindig elégedettek legyenek.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Colonnade' ,'A Colonnade egy nemzetközi biztosítótársaság, amely az autó-, egészségügyi és vagyonbiztosítások területén kínál széles skálájú termékeket. Az ügyfeleknek a lehető legjobb biztosítási megoldásokat és a legmagasabb szintű ügyfélszolgálatot kínálják.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Genertel' , 'A Genertel egy olasz biztosítótársaság, amely az autó-, lakás- és életbiztosítások területén tevékenykedik. Az ügyfeleknek az egyszerű és gyors biztosítási megoldásokat kínálják, amelyek segítenek biztonságban tartani őket és szeretteiket.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Insura' ,'Az Insura egy magyar biztosítótársaság, amely az egészség-, gépjármű-, vagyon- és felelősségbiztosítások területén tevékenykedik. Az ügyfeleknek a lehető legjobb biztosítási megoldásokat és az egyedi igényekre szabott szolgáltatásokat kínálják.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Kobe' ,'A Kobe egy nemzetközi biztosítótársaság, amely a felelősségbiztosítások területén tevékenykedik. Az ügyfeleknek széles skálájú biztosítási megoldásokat kínálnak, amelyek magas minőségűek és megfizethetőek.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Mabis' ,'A Mabis egy hazai biztosítótársaság, amely az egészség-, lakás-, és utasbiztosítások területén tevékenykedik. Az ügyfeleknek széles skálájú biztosítási megoldásokat és a legmagasabb szintű ügyfélszolgálatot kínálják.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Mondial' ,'A Mondial egy nemzetközi biztosítótársaság, amely az utasbiztosítások területén tevékenykedik. Az ügyfeleknek a lehető legjobb biztonságot és védelmet kínálják az utazásaik során.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Netrisk' ,'A Netrisk egy online biztosítótársaság, amely az autó-, lakás- és utasbiztosítások területén kínál széles skálájú termékeket. Az ügyfeleknek a lehető legjobb biztosítási megoldásokat és az egyszerű, gyors online kötési lehetőséget kínálják.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Pannonia' , 'A Pannonia egy hazai biztosítótársaság, amely a személyi biztosítások területén tevékenykedik. Az ügyfeleknek a lehető legjobb biztosítási megoldásokat és a legmagasabb szintű ügyfélszolgálatot kínálják.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Signal' , 'A Signal egy nemzetközi biztosítótársaság, amely az autó-, egészségügyi és vagyonbiztosítások területén kínál széles skálájú termékeket. Az ügyfeleknek a lehető legjobb biztosítási megoldásokat és az egyszerű, átlátható biztosításkötési lehetőséget kínálják.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'union' , 'A Union egy hazai biztosítótársaság, amely a vagyon-, élet- és egészségbiztosítások területén tevékenykedik. Az ügyfeleknek az egyedi igényeknek megfelelő biztosítási megoldásokat és a legmagasabb szintű ügyfélszolgálatot kínálják.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Uniqa' , 'A Uniqa egy nemzetközi biztosítótársaság, amely az autó-, egészségügyi és lakásbiztosítások területén tevékenykedik. Az ügyfeleknek a lehető legjobb biztosítási megoldásokat és a legmagasabb szintű ügyfélszolgálatot kínálják.');
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Waberer' , 'A Waberer egy hazai biztosítótársaság, amely az autó-, egészség- és vagyonbiztosítások területén kínál széles skálájú termékeket. Az ügyfeleknek az egyedi igényeknek megfelelő biztosítási megoldásokat és a legmagasabb szintű ügyfélszolgálatot kínálják.' );
INSERT INTO BIZTOSITO (NEV, LEIRAS) VALUES ( 'Zapmeta' , 'A Zapmeta egy nemzetközi biztosítótársaság, amely az autó-, egészségügyi és lakásbiztosítások területén tevékenykedik. Az ügyfeleknek a lehető legjobb biztosítási megoldásokat és az online biztosításkötési lehetőséget kínálják.' );
